  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Montana Easements
  outlines Refuge accomplishments from May through August of 1946. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, big game animals, furbearers,
  predators, rodents, and raptors- is also covered. The Refuge development and maintenance
  section discusses physical developments. The public relations section discusses
  Refuge visitors. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
